import { StyleSheet } from "react-native";

export default StyleSheet.create({
    page: {
        margin: '20%',
        borderColor: 'black',
        borderWidth: 1,
        width: '50%',
        alignItems: "center",
    },
    box: {
        display: "flex",
        flexDirection: "row",
    },
    btn: {
        margin: 10,
        borderColor: 'black',
        borderWidth: 2,
    },
    input:{
        margin: 5,
        borderColor: 'black',
        borderWidth: 2,
    }
})
